INSERT INTO `test_types` VALUES (3,1,'Gram Stain','GS','1 Hours','<p>used to differentiate bacteria into two groups, Gram-positive and Gram-negative, based on their cell wall structure</p>','','2021-04-14 14:13:47','2025-08-06 16:28:12',NULL,'NLIMS_TT_0003_MWI',NULL,'Gram Stain','Gram Stain','Both','Microscope','Lab Technologist and Lab Technicians','Gram Stain'),(4,1,'Culture and Sensitivity','C&S','7 Days','<p>To identify the microorganism causing an infection and determine the most effective antibiotic for treatment.</p>','','2021-04-14 14:13:47','2025-05-13 09:31:56',NULL,'NLIMS_TT_0004_MWI',NULL,'Culture & Sensitivity','Culture and Sensitivity','Both','Culture','Lab Technician','Culture & Sensitivity'),(5,1,'Cell Count','ClCt','1 Hours','<p>the process of determining the number of cells in a given sample, often within a specific volume</p>','','2021-04-14 14:13:47','2025-08-06 16:24:01',NULL,'NLIMS_TT_0005_MWI',NULL,'Cell Count','Cell Count','Both','Microscope, incubator, Neubauwer chamber, and others','Lab Technologist and Lab Technicians','Cell Count'),(6,1,'India Ink','II','1 Hours','<p>rapid diagnostic procedure used to detect the presence of encapsulated fungi, specifically Cryptococcus neoformans, in cerebrospinal fluid (CSF)</p>','','2021-04-14 14:13:47','2025-08-06 16:41:04',NULL,'NLIMS_TT_0006_MWI',NULL,'India Ink','India Ink','Both',NULL,'Lab technician','India Ink'),(7,1,'Differential','Diff','1 Hours','<p>Differential</p>','','2021-04-14 14:13:47','2025-08-06 16:52:08',NULL,'NLIMS_TT_0007_MWI',NULL,'Differential','Differential','Both',NULL,'Lab technician','Differential'),(8,1,'Ziehl-Neelsen (ZN) stain','ZN','30 min','<p>used to identify acid-fast bacteria, primarily mycobacteria, under a microscope</p>','','2021-04-14 14:13:47','2025-08-06 16:33:01',NULL,'NLIMS_TT_0008_MWI',NULL,'ZN Stain','Ziehl-Neelsen (ZN) stain','Both','Microscope','Lab Technologist and Lab Technicians','ZN Stain'),(9,1,'Wet Preparations','Wet Prep','30 Minutes','<p>To aid in the diagnosis of infections and disease conditions</p>','','2021-04-14 14:13:47','2025-08-07 15:55:45',NULL,'NLIMS_TT_0009_MWI',NULL,'Wet Prep','Wet Preparations','Female',NULL,NULL,'Wet prep'),(10,1,'TB Tests','TB','5 Hours','<p>To diagnose and monitor treatment of active TB</p>','','2021-04-14 14:13:47','2025-08-06 15:15:21',NULL,'NLIMS_TT_0010_MWI',NULL,'TB Tests','TB Tests','Both','Fluorescent Microscopy','Lab technicians','TB Tests'),(11,1,'Urine Macroscopy','UrineMacro','30 Minutes','<p>Assesses the physical characteristics of urine to help detect abnormalities related to hydration, kidney function, liver disease, infection, or metabolic conditions.</p>','','2021-04-14 14:13:47','2025-05-13 10:37:26',NULL,'NLIMS_TT_0011_MWI',NULL,'Urine Macroscopy','Urine Macroscopy','Both','Microscopy','Lab Technician','Urine Macroscopy'),(12,1,'Urine Microscopy','Urine Micro','1 Hour','<p>To detect and identify cells, crystals, bacteria, parasites, and other substances that can indicate infections, kidney disease, or other urinary tract disorders.</p>','','2021-04-14 14:13:47','2025-05-13 10:32:33',NULL,'NLIMS_TT_0012_MWI',NULL,'Urine Microscopy','Urine Microscopy','Both','Microscopy','Lab Technician','Urine Microscopy'),(13,1,'Urine Chemistries','UrineChem','30 Minutes','<p>Detect specific chemical substances in urine to help diagnose and monitor conditions such as diabetes, kidney disease, urinary tract infections (UTIs), and metabolic disorders.</p>','','2021-04-14 14:13:47','2025-08-19 09:29:54',NULL,'NLIMS_TT_0013_MWI',NULL,'Urine Chemistries','Urine Chemistries','Both','Miscroscopy','Lab Technician','Urine Chemistry'),(14,9,'Stool Analysis','StoA','2 hours','<p>To detect the presence of abnormal components in the stool which may indicate various conditions such as blood, mucus, parasites, bacteria, viruses, undigested food and abnormal PH levels</p>','','2021-04-14 14:13:47','2025-08-06 15:56:55',NULL,'NLIMS_TT_0014_MWI',NULL,'Stool Analysis','Stool Analysis','Both','Microscopy','Lab technicians','Stool Analysis'),(15,9,'Malaria Screening','MalScr','1 Hours','<p>  To detect and diagnose infections by one or more human malaria parasite species <em>(P. falciparum, P. vivax,</em></p><p><em> P. malariae, P. ovale) </em>and monitor response to treatment</p><p><br></p>','','2021-04-14 14:13:47','2025-04-29 09:58:10',NULL,'NLIMS_TT_0015_MWI',NULL,'Malaria Screening','Malaria Screening','Both','Light microscopy, RDT','Trained staff i.e. clinicians, nurses, Hospital Attendants, HSAs, Lab technicians','Malaria Screening'),(17,9,'Semen Analysis','SA','30 Minutes','<p>To aid in the detection of Male infertility</p>','','2021-04-14 14:13:47','2025-08-07 15:07:23',NULL,'NLIMS_TT_0017_MWI',NULL,'Semen Analysis','Semen Analysis','Male','Microscopy','Lab technician','Semen Analysis'),(18,1,'HVS analysis','HVS','30 Minutes','<p>To identify and diagnose infections in the vaginal and reproductive tract</p>','','2021-04-14 14:13:47','2025-08-13 15:22:37',NULL,'NLIMS_TT_0018_MWI',NULL,'HVS analysis','HVS analysis','Female',NULL,NULL,'HVS analysis'),(19,4,'Syphilis Test','STS','30 Minutes','<p>To diagnose or to aid in the diagnosis of syphilis</p>','','2021-04-14 14:13:47','2025-04-20 11:47:05',NULL,'NLIMS_TT_0019_MWI',NULL,'Syphilis Test','Syphilis Test','Both','RDT','Any other Trained personnel','Syphilis Test'),(20,4,'Hepatitis B Test','HBsAg','30 Minutes','<p>To screen for Hepatitis B and to aid in the diagnosis of chronic &nbsp;&nbsp;Hepatitis B infection</p>','','2021-04-14 14:13:47','2025-04-20 11:26:52',NULL,'NLIMS_TT_0020_MWI',NULL,'Hepatitis B Test','Hepatitis B Test','Both','RDT','Any trained staff','Hepatitis B Test'),(21,4,'Hepatitis C Test','HCVAB','30 Minutes','<p>To screen for Hepatitis C and to aid in the diagnosis of chronic&nbsp;&nbsp;Hepatitis C infection</p>','','2021-04-14 14:13:47','2025-04-20 11:29:47',NULL,'NLIMS_TT_0021_MWI',NULL,'Hepatitis C Test','Hepatitis C Test','Both','RDT','Any trained staff','Hepatitis C Test'),(22,6,'R